//Parameter data is published as an object.
//This sample data contains: 
//  2 timestamps (1 and 2).
//  2 numeric values and 2 string values.
//  notice that the numeric and string values each have 2 values.
//  One value for each timestamp.
// The number of values must match the number of timestamps.
// The stringValue and numericValue keys can be any string value you require.
// For example 'property1' can be anything you require like 'gForce_X' or 'lattitude'.
//  For more info, including the full list of filters, see swagger and quix docs.
// https://writer-quix-{{your-workspace-id}}.platform.quix.ai/swagger/index.html
{
    "epoch": 0,
    "timestamps": [1, 2],
    "numericValues": {
        "property1": [1, 3],
        "property2": [2, 6]
    },
    "stringValues": {
        "s1": ["10", "20"],
        "s2": ["Timestamp 1", "Timestamp 2"]
    }
}

// Events are published as an array of objects.
// Each event requires:
// timestamp, id and value
// You may optionally add as many tags as you need
//  For more info, including the full list of filters, see swagger and quix docs.
// https://writer-quix-{{your-workspace-id}}.platform.quix.ai/swagger/index.html
[ 
  {
    "timestamp": 1,
    "id": "event_001",
    "value": "Hello Quix",
    "tags": {
        "tag1": "Tag 1 value",
        "tag2": "Tag 2 value"
    }
  }
  // repeat for more events
]

// To retrieve data via this API you must persist the topic either in the Quix Platform or via the Portal API.
//  This query will return all data associated with this topic and event ID list.
//  For more info, including the full list of filters, see swagger and quix docs.
//  https://writer-quix-{{your-workspace-id}}.platform.quix.ai/swagger/index.html
{
    "topic": "postman",
    "eventIds": [
        "event_001"
    ]
}

// To retrieve data via this API you must persist the topic either in the Quix Platform or via the Portal API.
//  This query will return all data associated with a list of topic and event IDs.
//  For more info, including the full list of filters, see swagger and quix docs.
//  https://writer-quix-{{your-workspace-id}}.platform.quix.ai/swagger/index.html
{
    "topics": [
        "{{topic}}"
    ],
    "eventIds": [
        "event_001"
    ]
}

// To retrieve data via this API you must persist the topic either in the Quix Platform or via the Portal API.

//  This query will return all parameter data associated with a list of stream ID's.
//  For more info, including the full list of filters, see swagger and quix docs.
//  https://writer-quix-{{your-workspace-id}}.platform.quix.ai/swagger/index.html
