  "streamIds": [
    "postman"
  ]
}

// To retrieve data via this API you must persist the topic either in the Quix Platform or via the Portal API.
//  This query will return all streams in the streamId's list.
//  For more info, including the full list of filters, see swagger and quix docs.
//  https://writer-quix-{{your-workspace-id}}.platform.quix.ai/swagger/index.html
{
    "streamIds": [
        "postman"
    ]
}

